class LemonadeChange_860_Solution {

  public boolean lemonadeChange(int[] bills) {
    Map<Integer, Integer> kMap = new HashMap<>();
    kMap.put(5, 0);
    kMap.put(10, 0);
    kMap.put(20, 0);

    Boolean result = true;

    for (int i = 0; i < bills.length; i++) {
      int bill = bills[i];
      if (bill == 5) {
        Integer value = kMap.get(bill) + 1;
        kMap.put(bill, value);
        continue;
      }

      if (bill == 10) {
        if (kMap.get(5) > 0) {
          kMap.put(5, kMap.get(5) - 1);
          Integer value = kMap.get(bill) + 1;
          kMap.put(bill, value);
          continue;
        }
      }

      if (kMap.get(5) > 0 && kMap.get(10) > 0) {
        kMap.put(5, kMap.get(5) - 1);
        kMap.put(10, kMap.get(10) - 1);
        Integer value = kMap.get(bill) + 1;
        kMap.put(bill, value);
        continue;
      }

      if (kMap.get(5) >= 3) {
        kMap.put(5, kMap.get(5) - 3);
        Integer value = kMap.get(bill) + 1;
        kMap.put(bill, value);
        continue;
      }

      result = false;
    }

    return result;
  }
}
